   "POST /column/articleDetail.html":{"articleInfo":{"sectionCode":"news","title":"央行为降准降温 强调系统性金融风险底线","sectionName":"动态资讯","isRecommend":"0","isTop":"0","content":"<p style=\"margin-top: 10px; margin-bottom: 10px; font-family: &#39;Microsoft YaHei&#39;, arial; text-indent: 37px; color: rgb(102, 102, 102); white-space: normal; line-height: 24px;\"><span style=\"font-size: 19px; line-height: 28.5px; font-family: 仿宋; color: black;\">8</span><span style=\"font-size: 19px; line-height: 28.5px; font-family: 仿宋; color: black;\">月5日，中国人民银行发布第二季度货币政策执行报告。对于市场最关心的降息降准，在本次报告的专栏中，央行匠心独运地以保持资产负债表平衡的视角来解释货币政策的基本逻辑，表明央行对频繁降准的顾虑。<br/>&nbsp;&nbsp;&nbsp;&nbsp;</span></p><p style=\"margin-top: 10px; margin-bottom: 10px; font-family: &#39;Microsoft YaHei&#39;, arial; text-indent: 37px; color: rgb(102, 102, 102); white-space: normal; line-height: 24px;\"><span style=\"font-size: 19px; line-height: 28.5px; font-family: 仿宋; color: black;\">专栏表示，在资产负债表的视角下，央行只能通过增加其他负债或者减少资产来平衡降准带来的影响。而由于目前的宏观环境下，央行过增发央票、扩大现金投放等来扩大负债并不具有可操作性，降准引起的负债减少需要通过资产方的调整来平衡，2014年下半年以来就表现为资产方的外汇储备也相应减少。</span></p><div><span style=\"font-size: 19px; line-height: 28.5px; font-family: 仿宋; color: black;\"><br/></span></div><p><br/></p>","remark":"央行为降准降温 强调系统性金融风险底线","clicks":0,"createTime":1470647270000,"picPath":"/data/img/article/20160808/1608080698629713.jpg","url":"","deleteFlag":"0","uuid":"ae1eb443ddff45af9e60d29c4b14cc03","next":"11","previous":"222"}},

   "POST /column/articleList.html":{"articleInfo":{"sectionCode":"news","title":"央行为降准降温 强调系统性金融风险底线","sectionName":"动态资讯","isRecommend":"0","isTop":"0","content":"<p style=\"margin-top: 10px; margin-bottom: 10px; font-family: &#39;Microsoft YaHei&#39;, arial; text-indent: 37px; color: rgb(102, 102, 102); white-space: normal; line-height: 24px;\"><span style=\"font-size: 19px; line-height: 28.5px; font-family: 仿宋; color: black;\">8</span><span style=\"font-size: 19px; line-height: 28.5px; font-family: 仿宋; color: black;\">月5日，中国人民银行发布第二季度货币政策执行报告。对于市场最关心的降息降准，在本次报告的专栏中，央行匠心独运地以保持资产负债表平衡的视角来解释货币政策的基本逻辑，表明央行对频繁降准的顾虑。<br/>&nbsp;&nbsp;&nbsp;&nbsp;</span></p><p style=\"margin-top: 10px; margin-bottom: 10px; font-family: &#39;Microsoft YaHei&#39;, arial; text-indent: 37px; color: rgb(102, 102, 102); white-space: normal; line-height: 24px;\"><span style=\"font-size: 19px; line-height: 28.5px; font-family: 仿宋; color: black;\">专栏表示，在资产负债表的视角下，央行只能通过增加其他负债或者减少资产来平衡降准带来的影响。而由于目前的宏观环境下，央行过增发央票、扩大现金投放等来扩大负债并不具有可操作性，降准引起的负债减少需要通过资产方的调整来平衡，2014年下半年以来就表现为资产方的外汇储备也相应减少。</span></p><div><span style=\"font-size: 19px; line-height: 28.5px; font-family: 仿宋; color: black;\"><br/></span></div><p><br/></p>","remark":"央行为降准降温 强调系统性金融风险底线","clicks":0,"createTime":1470647270000,"picPath":"/data/img/article/20160808/1608080698629713.jpg","url":"","deleteFlag":"0","uuid":"ae1eb443ddff45af9e60d29c4b14cc03","nextUuid":"11","nextTitle":"11","previousUuid":"222","previousTitle":"11"}},

